import React from "react";
import Button from "./Transaction.js";

function Table(){
    return (
        <table className="table">
            <thead>
            <tr>
                <th>Date</th>
                <th>Description</th>
                <th>Category</th>
                <th>Amount</th>
            </tr>
            </thead>

        </table>
    )
}

function tableBody({date, description, category, amount}){
    return (
        <tbody>
            <tr>
                <td>{date}</td>
                <td>{descriptionescription}</td>
                <td>{category}</td>
                <td>{amount}</td>
            </tr>
        </tbody>
    )
}

export default Table;
